import './Detail.css';


 function Detail(){
    return(
        <div className='details'>
            <h1>Details</h1>
            <h3>COMPANY DETAILS</h3>
            Company:Epam
            <p>EPAM Systems, Inc. is an American company that specializes in service development,
                 digital platform engineering, and digital product design. One of the world's largest
                  manufacturers of custom software and consulting providers. The company's headquarters is located in Newtown, 
                Pennsylvania, and its branches are represented in more than 40 countries.</p>
        </div>
    )
 }
 export default Detail;
